import ButtonComponent from "../../components/ButtonComponent/ButtonComponent";
import CardComponent from "../../components/CardComponent/CardComponent";
import NavbarComponent from "../../components/NavbarComponent/NavbarComponent";
import { WrapperButtonMore } from "./style";


const HomePage = () =>
{
    return(
        <div id="container" style={{background: '#efefef', padding: '0 120px', height: '1000px', width: '100%', justifyContent: 'center'}}>
            <div style={{marginTop: '20px', display: 'flex', alignItems: 'center', gap: '20px', flexWrap: 'wrap'}}>
                <CardComponent/>
                <CardComponent/>
                <CardComponent/>
                <CardComponent/>
                <CardComponent/>
                <CardComponent/>
            </div>
            <div style={{width: '100%', display: 'flex', alignItems: 'center', marginTop: '10px'}}>
                <WrapperButtonMore
                textbutton= "Xem thÃªm" type="outline" styleButton={{border: '1px solid rgb(11,116,229)', color: 'rgb(11,116,229)',
                width: '120px', height: '38px', borderRadius: '4px'}}
                styleTextButton={{fontWeight: '500'}}/>
            </div>
            <div>
                <NavbarComponent/>
            </div>
        </div>
        
    )
}

export default HomePage;
